define({"topics" : [{"title":"VoIP Trunk Setup","shortdesc":"\n                  <p class=\"shortdesc\"></p>\n               ","id":"concept_l5v_vch_4fb","href":"topic\/voip_trunk_setup.html","menu": {"hasChildren":false,},"tocID":"concept_l5v_vch_4fb-d46e7787","next":"concept_l5v_vch_4fb-d46e7787",},{"title":"Advanced VoIP Trunk Configuration","shortdesc":"\n                  <p class=\"shortdesc\">Generally, you can set up a VoIP trunk successfully by configuring the settings on         the trunk <span class=\"ph uicontrol\">Basic</span> page. Depending on the ITSP, you may need to adjust         the codecs, VoIP advanced settings, or set up DOD number to make\n                     your VoIP trunk         work.\n                  </p>\n               ","id":"topic_pyd_f3t_2fb","href":"topic\/advanced_voip_trunk_configuration.html","menu": {"hasChildren":false,},"tocID":"topic_pyd_f3t_2fb-d46e8082","next":"topic_pyd_f3t_2fb-d46e8082",},{"title":"WebRTC Click-to-Call","shortdesc":"\n                  <p class=\"shortdesc\">WebRTC (Web Real-Time Communication) is a collection of communications protocols and         application programming interfaces\n                     that enable real-time communication over peer-to-peer         connections. <span class=\"ph\">Yeastar Cloud PBX</span> supports WebRTC Click-to-Call that allows the         website visitors calling to a pre-configured destination by clicking\n                     a link\/button the web         page.\n                  </p>\n               ","id":"topic_gg2_w21_kfb","href":"topic\/webrtc_click_to_call.html","menu": {"hasChildren":false,},"tocID":"topic_gg2_w21_kfb-d46e8369","next":"topic_gg2_w21_kfb-d46e8369",}]});